      content: >+
        [color=#009100]     [head=2]Official Central Command Note[/head]

         [/color]   

        [color=red]Concerning Shoukou's Xenoarch Setup[/color]

        Just so you [italic]idiots[/italic] know what you're doing with the setup here for the artifact chamber:

        - The pump pointing into the chamber, right under the chair where your analysis console probably is, injects air into the chamber from the air distribution pipes.

        - The pump next to it pointing the opposite direction is connected to the waste distribution pipes. It helps take air waste out when you use it, through the passive vent. 

        - The final pump, connected to that connector, is simple - just hook up a canister and press it and it puts the air into the canister in the chamber.


        Do note that the first pump will be handy after you space the chamber using the blast doors, and that those blast doors also can help you empty things like plasma from the chamber if you flood it to activate an artifact.

        The engineers who built the blast door setup have worked hard to make it idiotproof, so that you don't die to the spacing opening those causes. 

        It's not the most [italic]efficient setup,[/italic] but it works for what's in our budget.


        I hope you, the scientist reading this, makes this lab explode with interesting xenoarchaeological findings, and that you pave the way for a better future with the research you do.

        Thanks for working as part of Nanotrasen!

        [color=indigo]- Darius Adelaide, Central Command Epistemics Branch R.D.[/color]

