        [color=#1b67a5]      [head=3]SHOUKOU "Little Port" STATION[/head]

               [/color]

        

                                 Waves crash on the shore,   
                         Tides shift, sands rearrange, change      
                                   Nature's constant dance.    

        


        Shoukou's been in rotation for around for almost two years now; originally this station was created by Colin_Tel, like many maps, at the beginning of 2023.

        It has always been a station intended as a location for long term work and as a stop for passersby.

        Colin fell out of love with Shoukou, so then Shoukou was embellished and changed around by Adrian >'-'<, and then it was being maintained by Adeinitas for a short period who originally wrote this note. As of today, it is being maintained by Unkn0wn_Gh0st. 

        It has been with a community through hell and back.

        Regarding that, this map is dedicated to what came before the Delta-V Community, and whatever comes in it and many other servers (who are using this map, at least's) futures to come.


        Now that you've read this, I suggest you get back to Engineering and out of the station anchor room before something bad happens.



